Build a TEP102 Alarm from an Atmega128 hardware timer and one of its
compare registers.
@param frequency_tag The frequency tag for this Alarm
@param timer_size The width of this Alarm
@param mindt The shortest time in the future this Alarm can be set
  (in its own time units). Has to be at least 2, as setting a compare
  register one above the current counter value is unreliable. Has to be
  large enough that the Alarm time does not pass between the computation
  of <code>expires</code> and actually setting the compare register.
  Check this (for high-frequency timers) by inspecting the generated
  assembly code...

@author Martin Turon <mturon@xbow.com>
@author David Gay <david.e.gay@intel.com>

Build a TEP102 Counter from an Atmega128 hardware timer.
@param frequency_tag The frequency tag for this Counter
@param timer_size The width of this Counter

@author Martin Turon <mturon@xbow.com>

TransformAlarmCounterC decreases precision and/or widens an Alarm/Counter
pair. This component has a reduced interrupt overhead compared to using
TransformAlarmC and TransformCounterC separately. However, it is not as 
useful for hardware timers with multiple compare registers.

@param to_precision_tag A type indicating the precision of the transformed
  interfaces.
@param to_size_type The type for the width of the transformed interfaces.
@param from_precision_tag A type indicating the precision of the original
  interfaces.
@param from_size_type The type for the width of the original interfaces.
@param bit_shift_right Original time units will be 2 to the power 
  <code>bit_shift_right</code> larger than transformed time units.
@param upper_count_type A type large enough to store the upper bits --
  those needed above from_size_type after its shift right to fill
  to_size_type.

@author Cory Sharp <cssharp@eecs.berkeley.edu>
@author David Gay

AlarmToTimerC converts a 32-bit Alarm to a Timer.  

<p>See TEP102 for more details.
@param precision_tag A type indicating the precision of the Alarm and
Timer being converted.

@author Cory Sharp <cssharp@eecs.berkeley.edu>

VirtualizeTimerC uses a single Timer to create up to 255 virtual timers.

<p>See TEP102 for more details.

@param precision_tag A type indicating the precision of the Timer being 
  virtualized.
@param max_timers Number of virtual timers to create.

@author Cory Sharp <cssharp@eecs.berkeley.edu>

CounterToLocalTimeC converts a 32-bit LocalTime to a Counter.  

<p>See TEP102 for more details.
@param precision_tag A type indicating the precision of the LocalTime and
Counter being converted.

@author Cory Sharp <cssharp@eecs.berkeley.edu>

