The Active Message accessors, which provide the AM local address and
functionality for querying packets. Active Messages are a single-hop
communication protocol. Therefore, fields such as source and destination
represent the single-hop source and destination. Multihop sources and
destinations are defined by the corresponding multihop protocol (if any).
Also see the Packet interface.

@author Philip Levis 
@date   January 18 2005
@see    Packet
@see    AMSend
@see    TEP 116: Packet Protocols

Return the AM address of the source of the AM packet.
If <tt>amsg</tt> is not an AM packet, the results of this command
are undefined.
@param amsg  the packet
@return      the source address of the packet.

Return the AM address of the destination of the AM packet.
If <tt>amsg</tt> is not an AM packet, the results of this command
are undefined.
@param amsg    the packet
@return        the destination address of the packet.

Return the AM type of the AM packet.
If <tt>amsg</tt> is not an AM packet, the results of this command
are undefined.

@param  amsg   the packet
@return        the AM type


The interface to a TinyOS task scheduler.

@author Philip Levis
@date   January 19 2005
@see TEP 106: Tasks and Schedulers
@see TEP 107: Boot Sequence


Run the next task if one is waiting, otherwise return immediately. 

@return        whether a task was run -- TRUE indicates a task
               ran, FALSE indicates there was no task to run.

setSpeed. 
@param speed: The acceptable range is from 0-255.  However, a high
  speed with fresh batteries is somewhere around 70 or 80.
 @return Always returns SUCCESS.

setDir. 
@param direction: set robot direction to forward or reverse
   forward = 1
   reverse = 0
 @return Always returns SUCCESS.

setTurn. 
@param turn: The acceptable range is from 0-60 with
   straight = 30
   full left = 0
   full right = 60
 @return Always returns SUCCESS.

setSpeedTurnDirection. 
@param speed: The acceptable range is from 0-255.  However, a high
  speed with fresh batteries is somewhere around 70 or 80.
@param turn: The acceptable range is from 0-60 with
   straight = 30
   full left = 0
   full right = 60
@param direction: set robot direction to forward or reverse
   forward = 1
   reverse = 0
 @return Always returns SUCCESS.

Return the delay or period for the previously started timer. The next
fired event will occur at gett0() + getdt().
@return Timer's interval.

Check if timer is running. Periodic timers run until stopped or
replaced, one-shot timers run until their deadline expires.

@return TRUE if the timer is still running.

